fn main() {
    let input = "";
    let inputChars: Vec<char> = input.chars().collect();
    let units: Vec<char> = "abcdefghijklmnopqrstuvwxyz".chars().collect();
    let mut lowest = 9060;
    for unit in units {
        let mut removed = inputChars.clone();
        removed.retain(|&x| {
            let xstr = x.to_string();
            if xstr == unit.to_string() || xstr == unit.to_uppercase().to_string() {
                return false;
            }
            return true;
        });
        let reacted = part1(removed.into_iter().collect());
        if reacted.len() < lowest {
            lowest = reacted.len();
        }
    }
    println!("{}", lowest);
}

fn part1(input: String) -> String {
    let mut after = String::from(input);
    loop {
        let mut chars: Vec<char> = after.chars().collect();
        let mut newChars: Vec<char> = Vec::new();
        for (i, c) in chars.iter().enumerate() {
            let prevResult = newChars.pop();
            let mut prev = ' ';
            match prevResult {
                Some(val) => { prev = val; },
                None => {},
            }
            if c.is_uppercase() {
                if c.to_lowercase().to_string() == prev.to_string() {
                    prev = ' ';
                } else {
                    if prev.to_string() != " " {
                        newChars.push(prev);
                    }
                    newChars.push(*c);
                }
            } else if c.is_lowercase() {
                if c.to_uppercase().to_string() == prev.to_string() {
                    prev = ' ';
                } else {
                    if prev.to_string() != " " {
                        newChars.push(prev);
                    }
                    newChars.push(*c);
                }
            }
        }
        
        let newAfter = newChars.into_iter().collect();
        if newAfter == after {
            break;
        }
        after = newAfter;
    }
    return after;
}
